import About from '../About/About';
import Contact from '../Contact/Contact';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

const Nav = () => {
    // const [headers, setHeaders] = useState(headerData);
